const places = {
    place: "London",
    country: "UK",
    coverImg: require("./objects/London.jpg")
}

export default function Place () {
    return (
        <div className="place">
                <img src= {places.coverImg} className="place--coverImg" alt={places.place}/>
                <div className="place--info">
                    <ReactSVG src="./objects/pinIcon.svg"/>
                    <p>hello</p>
                </div>
        
        </div>
    )
}
